import "./expenseApp.css";
function ExpenseApp() {
  return (
    <div>
      <div className="expense-item">
        <div>31 October 2021</div>
        <div className="expense-item__description">
          <h2>Hotel Fun</h2>
        </div>
        <div className="expense-item__amount">400</div>
      </div>
    </div>
  );
}

export default ExpenseApp;
